import ExpenseItem from "./components/ExpenseItem";

function App() {
  return (
    <main>
      <h1>Let's get started!!</h1>
      <ExpenseItem title="car 1" amount={600}></ExpenseItem>
      <ExpenseItem title="car 2" amount={500}></ExpenseItem>
      <ExpenseItem title="car 3" amount={400}></ExpenseItem>
      <ExpenseItem title="car 4" amount={800}></ExpenseItem>
    </main>
  );
}

export default App;
